import React from 'react'
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const SlickSlider = () => {
  return (
      <div>
          return (
          <Slider {...settings}>
              <div>
                  <h3>1</h3>
              </div>
              <div>
                  <h3>2</h3>
              </div>
              <div>
                  <h3>3</h3>
              </div>
              <div>
                  <h3>4</h3>
              </div>
              <div>
                  <h3>5</h3>
              </div>
              <div>
                  <h3>6</h3>
              </div>
          </Slider>
          );
}
      </div>
  )
}

export default SlickSlider
